import React from "react";
import "./ContentBox.js";
import ContentCard from "./ContentCards/ContentCard";
import ProjectDetails from "./ProjectDetailsBlock/ProjectDetails";
import Stopwatch from "./Timer/StopWatch";
import ChartContainer from "../Charts/LineChart";
const OverviewContentBox = () => {
  return (
    <div className="OverviewContentBox">
      <ContentCard title="Work Log" height="1">
        <Stopwatch />
      </ContentCard>
      <ContentCard title="Work Time Statistics" height="1">
        <ChartContainer />
      </ContentCard>
      <ProjectDetails />
      <ContentCard title="Schedule" height="0">
        <iframe
          src="https://calendar.google.com/calendar/embed?showTitle=0&showNav=0&showPrint=0&showTabs=0&showCalendars=0&showTz=0&mode=AGENDA&height=800&wkst=1&bgcolor=%23db694f&src=8m2gergpnwapfiht0384htn554%40group.calendar.google.com&color=%23B1440E&ctz=America%2FLos_Angeles"
          style={{ borderWidth: 0 }}
          width="100%"
          title="Calender"
          height="600"
          frameborder="0"
          scrolling="no"
        ></iframe>
      </ContentCard>
    </div>
  );
};
export default OverviewContentBox;
